import React from "react"
import styles from "./styles.module.scss"

const Professional = () => {
    return (
        <div className={styles.professionalContainer} >
            <h1>Título para o profissional</h1>
            <p>Experiências profissionais aqui</p>
        </div>
    )
}

export default Professional
